description:
Reformed streetwalker Sister Malina (Nikita Denise) violates her holy vows as her intense lesbian desires resurface. Concerned Father Thomas (Ian Whitcomb) is determined to help the gorgeous nun, but a manipulative Mother Superior (Magdalene St. Michaels) seeks to expose the troubled beauty as a demonic nymphomaniac. Starring Magdalene St. Michaels, Nikita Denise, Lara Brooks, Veronica Snow and Odette Delacroix. Featuring Ian Whitcomb as Father Thomas. Written and directed by Nica Noelle.

